import React from 'react';
import ProductList from './components/ProductList';
import ProductForm from './components/ProductForm';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Gestion des Produits</h1>
      <ProductForm onProductAdded={handleProductAdded} />
      <ProductList />
    </div>
  );
}

export default App;
